import React, { useState } from "react";
import {View,Text,FormControl,Input,InputField,Button,ButtonText, FormControlError, FormControlHelper, FormControlHelperText, FormControlErrorText, AlertCircleIcon, FormControlErrorIcon, Spinner, Box, VStack,} from "@gluestack-ui/themed";
import Background_Login from "../../components/BackGround";

import { useFormik } from "formik";

import {getAuth, createUserWithEmailAndPassword } from "firebase/auth"
import {useNavigation} from "@react-navigation/native"
import {screen} from "../../utils"
import {initialValues, validationSchema} from "./RegisterForm.data";
import Toast from "react-native-toast-message";


  



const Register = () => {

  const [usuarioHaIniciadoSesion, setUsuarioHaIniciadoSesion] = useState(false);

  const navigation = useNavigation();

  const formik = useFormik({
    initialValues: initialValues(),
    validationSchema: validationSchema(),
    validateOnChange: false,
    onSubmit: async (formValue) => {
      try {
        const auth = getAuth();
        await createUserWithEmailAndPassword(
          auth, 
          formValue.email, 
          formValue.password
          );
          navigation.navigate(screen.account.login);
          setUsuarioHaIniciadoSesion(true);
      } catch (error) {
        Toast.show({
          type: "error",
          position: "bottom",
          text1: "Registration error, try later"
        })
      }
    },
  });

  return ( 
        <View
        flex={1}
        backgroundColor="black">
        <Background_Login></Background_Login>
            <VStack mx="$8"
                my="$20"
                space="lg"
                alignItems="center"
                style={{
                    justifyContent: "center",
                    flex: 1
                }}>
                <Box>
                    <Text size="3xl" fontWeight="bold" color='white' textAlign='center'>
                        Register
                    </Text>

                    <FormControl marginTop={"$4"} isInvalid={false} size={"md"} isDisabled={false} isRequired={true}>
                        {/* <FormControlLabel>
                            <FormControlLabelText color='white'>Email</FormControlLabelText>
                        </FormControlLabel> */}
                        <Input>
                            <InputField
                                type="text"
                                placeholder="Email"
                                bgColor='white'
                                borderRadius={'$xl'} 
                                fontWeight="$bold"/>
                        </Input>
                        <FormControlError>
                            <FormControlErrorIcon as={AlertCircleIcon} />
                            <FormControlErrorText>
                                Email invalid.
                            </FormControlErrorText>
                        </FormControlError>
                    </FormControl>


                    <FormControl marginTop={"$4"} size={"md"} isDisabled={false} isRequired={true}>
                        {/* <FormControlLabel>
                            <FormControlLabelText color='white'>Password</FormControlLabelText>
                        </FormControlLabel> */}
                        <Input>
                            <InputField
                                type="password"
                                placeholder="Password"
                                bgColor='white'
                                borderRadius="$xl" 
                                fontWeight="$bold"/>
                        </Input>

                        <FormControlError>
                            <FormControlErrorIcon as={AlertCircleIcon} />
                            <FormControlErrorText>
                                Atleast 6 characters are required.
                            </FormControlErrorText>
                        </FormControlError>
                    </FormControl>

                    <FormControl marginTop={"$4"} size={"md"} isDisabled={false} isRequired={true}>
                        {/* <FormControlLabel>
                            <FormControlLabelText color='white'>Repeat password</FormControlLabelText>
                        </FormControlLabel> */}
                        <Input>
                            <InputField
                                type="password"
                                placeholder="Repeat password"
                                bgColor='white'
                                borderRadius="$xl" 
                                fontWeight="$bold"/>
                        </Input>

                        <FormControlError>
                            <FormControlErrorIcon as={AlertCircleIcon} />
                            <FormControlErrorText>
                                Atleast 6 characters are required.
                            </FormControlErrorText>
                        </FormControlError>
                    </FormControl>

                    <Button
                        action={"primary"}
                        variant={"link"}
                        size={"md"}
                        marginVertical={"$1"}
                        isDisabled={false}
                        marginTop={"$3"}
                        onPress={() => navigation.navigate(screen.account.login)}>
                        <ButtonText
                            color='white'
                            size="sm"
                            fontWeight="$bold"
                            paddingRight={"$7"}>
                            Do you already have an account? Log in here
                        </ButtonText>
                    </Button>
                </Box>

                <Button
                    action={"primary"}
                    variant={"solid"}
                    size={"md"}
                    isDisabled={false}
                    bg="$black"
                    w={"$48"}
                    borderRadius={"$2xl"}
                    onPress={() => navigation.navigate("Login")}
                    style={{
                        alignContent: "center"
                    }}>
                    <ButtonText>
                        Register
                    </ButtonText>
                </Button>
            </VStack>
    </View>




    // <View>
