    //   <FormControl
    //     isInvalid={true}
    //     size={"lg"}
    //     isDisabled={false}
    //     isRequired={true}
    //     w={"$4/5"}
    //     marginTop={"$5"}
    //   >
    //     <Input borderRadius="$2xl" borderWidth="$0" h={"$12"}>
    //       <InputField
    //         type={"password"}
    //         placeholder="Password"
    //         backgroundColor="white"
    //         onChangeText={(text) =>
    //           formik.setFieldValue("repeatPassword", text)
    //         }
    //       />
    //     </Input>
    //     <FormControlError>
    //       <FormControlErrorText>{formik.errors.repeatPassword}</FormControlErrorText>
    //     </FormControlError>
    //   </FormControl>

    //   <Button onPress={formik.handleSubmit}>
    //     <Text>Iniciar sesion</Text>
    //   </Button>
      

    // </View>
  );
};
export default Register;
